import React from "react";
import { Link } from "react-router-dom";

const Nav = (props) => {
  return (
    <div>
        <Link to='/'>
            Home
        </Link>
        <Link to='/'>
            About
        </Link>
        <Link to='/'>
            Itinerary
        </Link>
        <Link to='/'>
            Home
        </Link>
        <Link to='/'>
            Home
        </Link>
    </div>
  );
};

export default Nav;
